import React from 'react'
import { Link } from 'react-router-dom'

export default function Facebook() {
  return (
    <div className="container">
      <h1>Home Page</h1>
      <p>
        <Link to="/https://github.com/taniarascia/router-example/blob/master/src/pages/HomePage.js">taniarascia</Link> on GitHub.
      </p>
    </div>
  )
}
